The Oath of Allegiance, also known as the Oath of Citizenship, is a sworn declaration of loyalty and allegiance to the United States of America, typically taken by immigrants who are becoming naturalized citizens of the United States. Here is the current version of the oath:

**Oath of Allegiance of the United States**

"I hereby declare, on oath, that I absolutely and entirely renounce and abjure all allegiance and fidelity to any foreign prince, potentate, state, or sovereignty of whom or which I have heretofore been a subject or citizen;

That I will support and defend the Constitution and laws of the United States of America against all enemies, foreign and domestic;

That I will bear true faith and allegiance to the same;

That I will bear arms on behalf of the United States when required by the law;

That I will perform noncombatant service in the Armed Forces of the United States when required by the law;

That I will perform work of national importance under civilian direction when required by the law; and

That I take this obligation freely, without any mental reservation or purpose of evasion; so help me God."

The oath is typically administered by a U.S. Citizenship and Immigration Services (USCIS) officer or a judge during a naturalization ceremony.

** Origins and History **

The oath has its roots in the Naturalization Act of 1790,

